<div style={{backgroundColor : '#000', height :'1px', width:'100%'  }} />
<div style={{backgroundColor : '#000', height :'1px', width:'100%'  }} />
</div>

      <header style={{backgroundColor : '#fff', color : '#000', minHeight:"100vh", maxWidth:"100vw", padding:"20px", alignItems:"center", display:"flex", flexDirection:"column", }}>

